Defendant Oshea A. Williams-Madison in court with attorney Thomas Evangelos Harris.  Joy Hammond appeared for the State of Wisconsin.  Deputy Court Clerk: dds.

Sentencing proceeded.  Statements made by the state, Suzanne M., MPD Officer Eric Dradger, defense, Donavon C., Toni S.-G., and defendant. 
 
The Court sentenced the defendant to a MAXIMUM TERM OF IMPRISONMENT of 6 YEARS, CONSECUTIVE to any other time being served with credit for 42 days served. The INITIAL TERM OF CONFINEMENT in the Wisconsin State Prison System is 2 1/2 YEARS.  The MAXIMUM TERM OF EXTENDED SUPERVISION IS 3 1/2 YEARS.

The defendant IS eligible for the Challenge Incarceration Program and the Substance Abuse Program- ONLY AFTER SERVING THE FIRST 15 MONTHS OF THIS SENTENCE.

CONDITIONS OF EXTENDED SUPERVISION:
*Obtain AODA assessment and if necessary successfully complete follow-up treatment;
*Absolute sobriety with random urine screens and breathalyzer tests;
*No drug dealing or association with drug community (drug users/dealers or drug houses);
*Cooperate with any and all rules set forth by the probation agent;
*No new law violations rising to the level of probable cause;
*No contact with victim Suzanne M.;
*No gang association or gang activity;
*No contact with Reggie Gibbs, Melchizedek Woods, Ransan Woods, Deishun Byrd McWay, Kevontae Gibbs, Larry Jefferson, Denasia Danzy, Malik Hill;
*Participate in Cognitive thinking program;
*Obtain/maintain full time employment or full time school and part time employment;
*Obtain high school diploma or ged or hsed;
*Pay all supervision fees;
*Provide DNA sample if not previously done so- pay surcharge;
*Pay all applicable mandatory surcharges, fees, assessments, and costs; 

State in compliance with victim rights legislation.  The Court orders restitution in the stipulated amount of $95.60 payable to Suzanne M.- bail to apply.  Defense disputes part of restitution request- hearing date to be given.   The Court ordered that all financial obligations and restitution be paid through collection of sums by the Department of Corrections from 25% of funds under Sec. 973.05(4)(b) and as a condition of extended supervision.  Any amount remaining due and owing is subject to civil judgment.  The Court orders $1,000 of bail held pending outcome of restitution hearing; $4,000 balance to be returned to remitter.  Pursuant to Wisconsin Statutes Section 973.176, the Court advised the defendant of the following restrictions:  Firearm possession and Voting.  Appeal rights given.
Filed;
-Notice of Right to Seek Postconviction Relief;
-Pretrial Incarceration Credit;
-Written Explanation of Determinate Sentence-copy to defendant.  Restitution hearing scheduled for March 5, 2015 at 08:30 am.
